import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const useStyles = makeStyles(theme => ({
  root: {
    width: '100%',
  },
  paper: {
    marginTop: theme.spacing(3),
    width: '100%',
    overflowX: 'auto',
    marginBottom: theme.spacing(2),
  },
  table: {
    minWidth: 650,
  },
}));




export default function DenseTable(props) {

//console.log('hello from dense table', props.data)
  const classes = useStyles();
    const miracle = props.data

  return (
    <div className={classes.root}>
      <Paper className={classes.paper}>
        <Table className={classes.table} size="small">
          <TableHead>
            <TableRow>
              <TableCell>Dessert (100g serving)</TableCell>
              <TableCell align="right">Calories</TableCell>
              <TableCell align="right">Fat&nbsp;(g)</TableCell>
              <TableCell align="right">Carbs&nbsp;(g)</TableCell>
              <TableCell align="right">Protein&nbsp;(g)</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
          {console.log('test', this.props.data.map)}
            {miracle.map(coin => (
              <TableRow key={coin.id}>
                <TableCell component="th" scope="coin">
                
                  {coin.name}
                </TableCell>
                {/* <TableCell align="right">{coin.calories}</TableCell>
                <TableCell align="right">{coin.fat}</TableCell>
                <TableCell align="right">{coin.carbs}</TableCell>
                <TableCell align="right">{coin.protein}</TableCell> */}
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </Paper>
    </div> 
  );
}
